import "./App.css";
import NavAll from "./nav";
import Footer from "./footer";
import Sevices from "./services";
import Guess from "./train";
import Form from "./form";
import ArrOp from "./array";
import ShapeEditor from "./shapes";
import { Link, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <NavAll />
      <Link to="/Guess" className="SERVICES">
        SERVICES
      </Link>
      <Routes>
        <Route path="/services" element={<Sevices />} />
      </Routes>
      <Link to="/Guess" className="Guess">
        Guess
      </Link>
      <Routes>
        <Route path="/Guess" element={<Guess />} />
      </Routes>
      <Form />
      <ArrOp />
      <ShapeEditor />

      <Footer />
    </div>
  );
}

export default App;
